import React from "react";
import AboutSection from '../AboutSection';
import CarouselSection from "../CarouselSection";

import {
  HeroContainer,
  HeroBlank,
  HeroActive
} from "./HeroElements";
const HeroSection = () => {
  return (
    <HeroContainer>
      <HeroBlank id="carousel"></HeroBlank>
      <HeroActive id="about">
        <AboutSection />
        <CarouselSection />
      </HeroActive>
    </HeroContainer>
  );
};

export default HeroSection;
